<!DOCTYPE html>
<html lang="en">
    <head>
      <meta charset="utf-8">
      <title>COVID-19 Ireland Numbers - Hop.ie</title>
      <meta name="viewport" content="width=device-width, initial-scale=1">
      <style>
        :root {
          --bg-color: white;
          --text-color: #333;
          --second-text-color: #666;
          --third-text-color: #999;
        }
        @media (prefers-color-scheme: dark) {
          :root {
            --bg-color: #222;
            --text-color: #ddd;
            --second-text-color: #aaa;
          }
        }
        body {
          background: var(--bg-color);
          font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
          font-size: 14px;
          color: var(--text-color);
          margin: 0;
        }
        header {
          display: flex;
          align-items: center;
          justify-content: space-between;
        }
        main {
          display: flex;
          width: 1200px;
          height: 628px;
          overflow: hidden;
          margin: 0 auto;
          position: relative;
        }
        svg text {
          shape-rendering: crispEdges;
        }
        h2 {
          color: var(--second-text-color);
          margin: 40px 0 10px;
          font-weight: normal;
        }
      </style>
      <script>
        const formatNumber = (number) => Intl.NumberFormat('en-UK').format(number);
        const dateOptions = { weekday: 'long', year: 'numeric', month: 'long', day: 'numeric' };
        const formatDate = (date) => new Date(date).toLocaleDateString("en-US", dateOptions);
      </script>
    </head>
    <body>
      <style>
        .summary {
          width: 66%;
        }
        .summary h2 {
          margin-top: 10px;
        }
        .summary ul {
          display: flex;
          flex-wrap: wrap;
          justify-content: space-between;
          border-radius: 10px;
          padding: 10px;
          margin: 20px 0;
          width: 100%;
        }
        .summary li {
          width: calc(50% - 50px);
          display: inline-block;
          list-style: none;
          font-size: 88px;
          padding: 10px 25px;
        }
        .summary li .label {
          display: block;
          font-size: 32px;
          color: #999;
        }
        h1 {
          display: flex;
          justify-content: space-between;
          font-size: 32px;
          position: absolute;
          color: #999;
          bottom: 20px;
          left: 30px;
          right: 30px;
          margin: 0;
        }
      </style>
      <main>
        <div class="summary">
          <ul>
            <li class="daily-cases">
              <span class="data">
                1,335
              </span>
              <span class="label">New cases</span>
            </li>
            <li class="avg-cases">
              <span class="data">
                1,298
              </span>
              <span class="label">7 day average</span>
            </li>
            <!-- <li class="avg-cases">1,298 <span class="label">7 day average</span></li>
            <li class="prev-average-cases">1,338 <span class="label">Previous 7 day average</span></li> -->
            <li class="daily-deaths">
              <span class="data">
                0
              </span>
              <span class="label">Deaths</span></li>
            <li class="in-hospital">
              <span class="data">
                296
              </span>
              <span class="label">In hospital</span></li>
            <li class="in-icu">
              <span class="data">
                65
              </span>
              <span class="label">In ICU</span></li>
            <li class="vaccinations-total">
              <span class="data">
                7,177,111
              </span>
              <span class="label">Total vaccine doses</span></li>
          </ul>
          <script>
            // Respond to show-date event
            document.querySelector('body').addEventListener('show-date', summaryDateHandler);
            const summary = document.querySelector('.summary');
            const summaryTitle = document.querySelector('.summary-title');
            const summaryData = {
              cases: document.querySelector('.summary .daily-cases .data'),
              deaths: document.querySelector('.summary .daily-deaths .data'),
              hospitalised: document.querySelector('.summary .in-hospital .data'),
              icu: document.querySelector('.summary .in-icu .data'),
              testing: document.querySelector('.summary .testing-positive .data'),
              vaccination: document.querySelector('.summary .vaccinations-total .data')
            }
            const todayData = {
              c: summaryData.cases.innerText,
              d: summaryData.deaths.innerText,
              h: summaryData.hospitalised.innerText,
              i: summaryData.icu.innerText,
              t: summaryData.testing.innerText,
              v: summaryData.vaccination.innerText,
            }
            function findByDate(date) {
              if (!window.inlineData) {
                return;
              } 
              return window.inlineData.find(function(d) {
                const date1 = new Date(d.date);
                const compare1 = `${date1.getUTCFullYear()} ${date1.getUTCMonth()} ${date1.getUTCDate()}`;
                const date2 = new Date(date);
                const compare2 = `${date2.getUTCFullYear()} ${date2.getUTCMonth()} ${date2.getUTCDate()}`;
                return compare1 === compare2
              });
            }
            function showSummaryData(data) {
              if (data.date) {
                summaryTitle.innerText = formatDate(data.date);
                if (!summary.classList.contains('changing')) {
                  summary.classList.remove('fade-in');
                  setTimeout(function() {
                    summary.classList.add('fade-in');
                  }, 10);
                }
                summary.classList.add('changing');
              } else {
                summary.classList.remove('changing');
                summary.classList.remove('fade-in');
                setTimeout(function() {
                  summary.classList.add('fade-in');
                }, 10);
                summaryTitle.innerText = 'Latest numbers';
              }
              
              summaryData.cases.innerText = data.c || 0;
              summaryData.deaths.innerText = data.d || 0;
              summaryData.hospitalised.innerText = data.h || 0;
              summaryData.icu.innerText = data.i || 0;
              summaryData.testing.innerText = data.t || 0;
              summaryData.vaccination.innerText = data.v;
            }
            function summaryDateHandler(e) {
              const date = e.detail;
              const data = findByDate(date);
              if (data) {
                // Format the numbers first
                const formatted = {
                  ...data,
                  c: formatNumber(data.c),
                  d: formatNumber(data.d),
                  h: formatNumber(data.h),
                  i: formatNumber(data.i),
                  v: formatNumber(data.v)
                }
                showSummaryData(formatted);
              } else {
                showSummaryData(todayData);
              }
            }
          </script>

    <script>
      const counties = [...document.querySelectorAll('.county')];
      const map = document.querySelector('#map');
      const mapTooltip = document.querySelector('.map-wrapper .tooltip');
      const mapCountyName = document.querySelector('.map-wrapper .tooltip .county-name');
      const mapCountyStat = document.querySelector('.map-wrapper .tooltip .county-stat');
      const mapCountyCases = document.querySelector('.map-wrapper .tooltip .county-cases');
      let mapListenerTimeout;
      // Mouse functions
      function showTooltip(e) {
        e.target.classList.add('active');
        mapTooltip.classList.add('active');
        map.classList.add('is-active');
        // Add mousemove event
        document.addEventListener('mousemove', moveMouse);
        // Set the tooltip content
        mapCountyName.innerText = e.target.getAttribute('name');
        mapCountyStat.innerText = e.target.getAttribute('data-case-percent');
        mapCountyCases.innerText = e.target.getAttribute('data-cases') + ' cases';
      }
      function hideTooltip(e) {
        e.target.classList.remove('active');
        mapTooltip.classList.remove('active');
        map.classList.remove('is-active');
        // Remove mousemove event, if there's no "active" county
        setTimeout(() => {
          const activeCounty = document.querySelector('.county.active');
          if (!activeCounty) {
            if (mapListenerTimeout) {
              document.removeEventListener('mousemove', moveMouse);
            }
          }
        }, 150);
      }
      function moveMouse(e) {
        const mapRect = map.getBoundingClientRect();
        const x = e.clientX - mapRect.x;
        const y = e.clientY - mapRect.y;
        const tooltipHeight = mapTooltip.getBoundingClientRect().height;
        mapTooltip.style.left = x + 3 + 'px';
        mapTooltip.style.top = y - tooltipHeight - 3 + 'px';
      };
      for (let i = 0; i < counties.length; i++) {
        const county = counties[i];
        // Add event listener for hover
        county.addEventListener('mouseenter', showTooltip);
        county.addEventListener('mouseout', hideTooltip);
      }
    </script>

    <script>
      const dailyCasesBars = document.querySelector('#cases #bars');
      const dailyCasesTooltip = document.querySelector('.daily-cases .tooltip')
      const casesDateEl = document.querySelector('.daily-cases .tooltip .date');
      const casesCasesEl = document.querySelector('.daily-cases .tooltip .cases');
      const casesAvgEl = document.querySelector('.daily-cases .tooltip .average');
      const vacPerDayEl = document.querySelector('.daily-cases .tooltip .vac-per-day');

      let dailyCasesRect;
      function clearCasesBars() {
        const allHoverBars = document.querySelectorAll('#cases .hover-bar');
        const allBars = document.querySelectorAll('#cases .bar');
        for (let i = 0; i < allHoverBars.length; ++i) {
          allHoverBars[i].classList.remove('active');
          allBars[i].classList.remove('active');
        }
      }
      function dailyCasesBarsMove(e) {
        clearCasesBars();
        if (e.target.matches(".hover-bar")) {
          // Send event to the summary
          const event = new CustomEvent('show-date', { bubbles: true, detail: e.target.getAttribute('data-key') });
          document.querySelector('body').dispatchEvent(event);
          // Set tooltip content
          const cases = formatNumber(+(e.target.getAttribute('data-cases')));
          const average = formatNumber(Math.round(+(e.target.getAttribute('data-avg'))));
          const date = formatDate(e.target.getAttribute('data-key'));
          const casesText = cases === '1' ? ' case' : ' cases';
          casesDateEl.innerText = date;
          casesCasesEl.innerText = cases + casesText;
          casesAvgEl.innerText = average +' (7-day average)';
          // Highlight the bar
          const parentGroup = e.target.parentElement;
          const bar = parentGroup.querySelector('.bar');
          bar.classList.add('active');
          e.target.classList.add('active');
          dailyCasesTooltip.classList.add('active');
          // Position the tooltip
          const x = e.clientX - dailyCasesRect.x;
          const y = e.clientY - dailyCasesRect.y;
          // Check width of the tooltip
          // If it's more than the distance to the right side, set the X accordingly
          // console.log(dailyCasesTooltip.getBoundingClientRect())
          const tooltipWidth = dailyCasesTooltip.getBoundingClientRect().width;
          const tooltipHeight = dailyCasesTooltip.getBoundingClientRect().height;
          const rightSide = x + tooltipWidth + 20;
          if (rightSide > dailyCasesRect.width) {
            dailyCasesTooltip.style.left = x - 10 - tooltipWidth + 'px';
          } else {
            dailyCasesTooltip.style.left = x + 10 + 'px';
          }
          dailyCasesTooltip.style.top = y - (tooltipHeight) + 'px';
        }
      }
      dailyCasesBars.addEventListener('mouseover', function(e) {
        dailyCasesBars.classList.add('active');
        dailyCasesRect = document.querySelector('#cases').getBoundingClientRect();
        dailyCasesBars.addEventListener('mousemove', dailyCasesBarsMove);
      });
      dailyCasesBars.addEventListener('mouseleave', function() {
        // Remove mousemove listener from dailyCasesBars
        clearCasesBars();
        dailyCasesBars.classList.remove('active');
        dailyCasesTooltip.classList.remove('active');
        dailyCasesBars.removeEventListener('mousemove', dailyCasesBarsMove);
        // Update summary
        const event = new CustomEvent('show-date', { bubbles: true, detail: null });
        document.querySelector('body').dispatchEvent(event);
      });
    </script>

    <script>
      // Shared data to show in summary also
      (function () {
        const area = document.querySelector('#hospitalised .hover-area');
        const tooltip = document.querySelector('.hospitalised-chart .tooltip');
        const hoverBar = document.querySelector('.hospitalised-chart .hover-bar');
        let rect;
        let areaRect;
        // Linear interpolation
        function convertRange( value, r1, r2 ) { 
          return ( value - r1[ 0 ] ) * ( r2[ 1 ] - r2[ 0 ] ) / ( r1[ 1 ] - r1[ 0 ] ) + r2[ 0 ];
        }
        
        function mouseMove(e) {
          if (!window.inlineData) return;
          const dataLength = window.inlineData.length;
          const day = Math.ceil(
            convertRange(
              e.clientX - areaRect.x,
              [0, areaRect.width],
              [0, dataLength]
            )
          ) - 1;
          // Put data inside tooltip
          // Send event to the summary
          const event = new CustomEvent('show-date', { bubbles: true, detail: window.inlineData[day].date });
          document.querySelector('body').dispatchEvent(event);

          if (window.inlineData[day]) {
            tooltip.classList.add('active');
            tooltip.querySelector('.date').innerText = formatDate(window.inlineData[day].date);
            tooltip.querySelector('.hosp').innerText = formatNumber(+(window.inlineData[day].h)) + ' hospitalised';
            tooltip.querySelector('.icu').innerText = formatNumber(+(window.inlineData[day].i)) + ' ICU';
            tooltip.querySelector('.deaths').innerText = formatNumber(+(window.inlineData[day].d)) + ' deaths';
          } else {
            tooltip.classList.remove('active');
          }
          // Place tooltip near cursor
          const x = e.clientX - rect.x;
          const y = e.clientY - rect.y;
          // Check width of the tooltip
          // If it's more than the distance to the right side, set the X accordingly
          const tooltipWidth = tooltip.getBoundingClientRect().width;
          const tooltipHeight = tooltip.getBoundingClientRect().height;
          const rightSide = x + tooltipWidth + 20;
          if (rightSide > rect.width) {
            tooltip.style.left = x - 10 - tooltipWidth + 'px';
          } else {
            tooltip.style.left = x + 10 + 'px';
          }
          tooltip.style.top = y - (tooltipHeight) + 'px';
          // Place hover bar
          hoverBar.style.left = x + 'px';
        }
        area.addEventListener('mouseenter', function() {
          rect = document.querySelector('#hospitalised').getBoundingClientRect();
          areaRect = area.getBoundingClientRect();
          tooltip.classList.add('active');
          hoverBar.classList.add('active');
          area.addEventListener('mousemove', mouseMove);
          // Set dimensions for .hospitalised-chart .hover-bar
          hoverBar.style.height = areaRect.height + 'px';
          hoverBar.style.top = areaRect.y - rect.y + 'px';
        });
        area.addEventListener('mouseleave', function() {
          tooltip.classList.remove('active');
          hoverBar.classList.remove('active');
          area.removeEventListener('mousemove', mouseMove);
          // Update summary
          const event = new CustomEvent('show-date', { bubbles: true, detail: null });
          document.querySelector('body').dispatchEvent(event);
        });
      })();
    </script>
